import { BrowserRouter, Route, Routes } from "react-router-dom";
import React from "react";
import LandingPage from "./LandingPage"

function App() {
  return (

    <div className="App">
        <BrowserRouter>
        <Routes>
          <Route  path="/" elements={<LandingPage />} />
        </Routes>

        </BrowserRouter>

    </div>
  );
}

export default App;
